We are going to add crates to our workspace as we go. The first crate is going to be our core crate. cargo new quiz_core --lib --vcs none We do not need a version control system on the new crates since it already created one when we ran cargo new quiz-library. Then add quiz_core to the root Cargo.toml. [workspace]
members = [ "quiz_core"
] The result of this part should have this folder structure: Cargo.lock and target might be missing if the project wasn't built yet.

14.body:
I like to separate the client from the library by using different crates. It is a small amount of work yet it makes our project future-proof. For example, adding a GUI dependency for our client. We will do the same as we did for the core crate. Create another crate and add it to the workspace. cargo new apps/rust_client --bin --vcs none [workspace]
members = [ "quiz_core", "apps/rust_client"
] Now we can test it by running: cargo run --bin rust_client
# Hello, world! Sturcture: We put the rust client inside an app folder because we will introduce other applications. For iOS, android, and web. Finally, we need to add and use the library inside the rust client crate we created. cargo add -p rust_client --path quiz_core/ // apps/rust_client/src/main.rs
use quiz_core::add; fn main() { println!("2 + 2 = {}", add(2, 2));
} Run again. cargo run --bin rust_client
# 2 + 2 = 4 The setup is done! Now we can focus on writing the actual library.
